script: |
  super -f text -I q4671.spq | sort > q4671.out

inputs:
  - name: q4671.spq
    data: |
      SELECT DISTINCT + + col0 * cor0.col2 - - col2 / - ( - ( cor0.col0 ) + cor0.col2 * + cor0.col1 ) FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q4671.out
    data: |
      35
      7298
      792
